commits.content:
* {
    box-sizing: border-box;
}
body {
    background-image: url(IMG_9728.JpG);
}
nav {
    display: flex;
}
header a {
    text-decoration: none;
    padding: 10px;
    max-width: 320%;
    font-size: 20px;
    color: white;



 }
.signup-box {
    width: 460px;
    height: 620px;
    margin: auto;
    background-color: darkturquoise;
    border-radius: 10px;
}
h1 {
    text-align: center;
    padding-top: 15px;
}
h4 {
    text-align: center;
}
form {
     width: 300px;
     margin-left: 40px;
}
form label {
     display: flex;
     font-size: 18px;
     margin-top: 20px;
}
form input {
    width: 100%;
    border: none;
    padding: 7px;
    border-radius: 8px;
    outline: none;
    border: 1px brown;

}
input[type="button"]{
    width: 300px;
    height: 35px;
    margin-top: 20px;
    border: none;
    color: blue;
    background-color:lightblue;
    font-size: 15px;
}
p{
    text-align: center;
}
